import React from 'react';
import { Profile } from './Profile.js';
import nba from 'nba';

window.nba = nba;

export class Main extends React.Component {

    componentDidMount() {
        console.log('Find Player ID for Stephen Curry:');
        console.log(nba.findPlayer('Stephen Curry').playerId);
        console.log('Player Info:');
        nba.stats.playerInfo({PlayerID: 201939}).then(
            (playerInfo) => console.log(playerInfo)
        );

    }

    render() {
        return (
            <div className="main">
                <Profile />
                <div >ShotChart</div>
            </div>
        );
    }
}
